import React from 'react';
import FluenceMapRow from './FluenceMapRow.js'

class FluenceMap extends React.Component {
    render() {
        return (
            <div>
                <FluenceMapRow row={this.props.matrix[0]} />
                <FluenceMapRow row={this.props.matrix[1]} />
                <FluenceMapRow row={this.props.matrix[2]} />
                <FluenceMapRow row={this.props.matrix[3]} />
                <FluenceMapRow row={this.props.matrix[4]} />
                <FluenceMapRow row={this.props.matrix[5]} />
                <FluenceMapRow row={this.props.matrix[6]} />
                <FluenceMapRow row={this.props.matrix[7]} />
            </div>
        );
    }
}

export default FluenceMap;
